      string: '{"meta":{"code":200},"response":{"count":41424,"messages":[{"id":"141473731270076540","source_guid":"fdbd787042f50132027722000b468b69","created_at":1414737312,"user_id":"10041732","group_id":"4009063","name":"Bruce
        Rabinowitz Vonage","avatar_url":"http://i.groupme.com/1280x960.jpeg.59871b9d4a504f5fbb6d5f06b74d0a2c","text":"If
        there are any questions about this, please address them to me.  I won''t answer
        them, but maybe you''ll feel better for asking.  I kid.  Ask me whatever you
        need to know and as always, I will do my best to answer your questions and
        concerns.  Now, have a good evening, or a great day, whatever the case may
        be :)","system":false,"attachments":[],"favorited_by":[],"sender_type":"user","sender_id":"10041732"},{"id":"141473714435906101","source_guid":"9966923042f50132c1c522000b1b10d4","created_at":1414737144,"user_id":"10041732","group_id":"4009063","name":"Bruce
        Rabinowitz Vonage","avatar_url":"http://i.groupme.com/1280x960.jpeg.59871b9d4a504f5fbb6d5f06b74d0a2c","text":"So
        if they cancel in month 6, they will pay $60 to get out.  If they cancel in
        month 3, they will pay $90 to get out.  If they cancel in month 11, they will
        pay $10 to get out.  Does everyone understand this?  It''s $10 a month for
        the remainder of the 12 months. What happens if they cancel in month 13 you
        may ask?  Don''t ask such a ridiculous question.  It''s a 1 year deal!  There''s
        only 12 months in the year.  Stop being difficult! :)","system":false,"attachments":[],"favorited_by":[],"sender_type":"user","sender_id":"10041732"},{"id":"141473691821014083","source_guid":"129afe4042f501321d3e22000b280106","created_at":1414736918,"user_id":"10041732","group_id":"4009063","name":"Bruce
        Rabinowitz Vonage","avatar_url":"http://i.groupme.com/1280x960.jpeg.59871b9d4a504f5fbb6d5f06b74d0a2c","text":"Of
        course these prices are BEFORE taxes and fees. So $9.99 will be ABOUT $17
        out the door.  That''s an approximation.  Maybe a few cents less, maybe a
        few cents more.  The only other thing you need to know about these contract
        plans, is that while they still have a 30 day money back guarantee, if they
        cancel the contract there IS an early termination fee of $10 for each month
        left in their contract.","system":false,"attachments":[],"favorited_by":[],"sender_type":"user","sender_id":"10041732"},{"id":"141473648333388836","source_guid":"0f66220042f4013283ca22000b10953c","created_at":1414736483,"user_id":"10041732","group_id":"4009063","name":"Bruce
        Rabinowitz Vonage","avatar_url":"http://i.groupme.com/1280x960.jpeg.59871b9d4a504f5fbb6d5f06b74d0a2c","text":"In
        addition to the no contract plans you now offer, you may also offer an option
        to your customers to have a 1 year contract. The plans are the same as what
        you now sell, only with 1 year contract pricing if they want it.  If they
        want the U.S. Unlimited plan on a 1 year deal, it''s $9.99 for 6 months, then
        steps up to $25.99 for the next 6 months. The Vonage World plan on a one year
        deal is $9.99 for 6 months, then $27.99 for the next 6 months","system":false,"attachments":[],"favorited_by":[],"sender_type":"user","sender_id":"10041732"},{"id":"141473608348706499","source_guid":"2112584042f301326b5022000b130f97","created_at":1414736083,"user_id":"10041732","group_id":"4009063","name":"Bruce
        Rabinowitz Vonage","avatar_url":"http://i.groupme.com/1280x960.jpeg.59871b9d4a504f5fbb6d5f06b74d0a2c","text":"Good
        evening team...or good morning, depending on when you are reading this :)
        \nSo we will have two new plans to sell beginning today.  These are NOT in
        the brochure, but will be available to pick when you sign people up.  They
        are both 1 year contract deals. There is one plan for U.S./Canada/Puerto Rico,
        and one for Vonage World.  What are they?  Well, I''m so glad you asked!","system":false,"attachments":[],"favorited_by":[],"sender_type":"user","sender_id":"10041732"}]}}'
